import "./Queue.css";
import { arrayMoveImmutable } from "array-move";

import QueueItem from "./QueueItem.jsx";

export default function Queue() {
	var queue = ["365", "Von Dutch", "Guess", "Club Classics"];

	// Define a callback for QueueItems to call when they are moved
	function moveItem(startIndex, endIndex) {
		queue = arrayMoveImmutable(queue, startIndex, endIndex);
	}

	return (
		<ol className="Queue">
			{/* Iterate through list and generate QueueItems with unique keys */}
			{queue.map((url, idx, array) => (
				<QueueItem key={idx} url={url} index={idx} moveCallback={moveItem} />
			))}
		</ol>
	);
}
